import React, { useState } from 'react';
import axios from 'axios';

// Stub components to replace missing @descope/web-js SDK package
const AuthProvider: React.FC<{ projectId: string; children?: React.ReactNode }> = ({ children }) => <>{children}</>;
const Descope: React.FC<{
  flowId: string;
  theme?: string;
  onSuccess?: (e: any) => void;
  onError?: (e: any) => void;
}> = ({ onSuccess }) => {
  return (
    <div style={{ padding: 20, border: '1px solid #ccc', borderRadius: 8 }}>
      <p>Login (Stub) - flowId: help-agent-flow</p>
      <button
        onClick={() => {
          const fakeEvent = {
            detail: {
              user: { email: 'user@example.com', name: 'User Example' },
              session: { token: 'fake-session-token' },
            },
          };
          onSuccess && onSuccess(fakeEvent);
        }}
      >
        Sign In
      </button>
    </div>
  );
};

export default function HelpSharingAgent() {
  const [user, setUser] = useState<{ email: string; name?: string } | null>(null);
  const [sessionToken, setSessionToken] = useState<string | null>(null);
  const [message, setMessage] = useState('');
  const [dateTime, setDateTime] = useState('');
  const [loading, setLoading] = useState(false);
  const [consentSuccess, setConsentSuccess] = useState(false);

  async function createEvent() {
    if (!user || !sessionToken) {
      alert('Please log in first');
      return;
    }
    if (!message.trim() || !dateTime) {
      alert('Please enter a message and date/time');
      return;
    }
    setLoading(true);
    try {
      const event = {
        summary: 'Neighborhood Help Request',
        description: message.trim(),
        start: {
          dateTime: new Date(dateTime).toISOString(),
          timeZone: Intl.DateTimeFormat().resolvedOptions().timeZone,
        },
        end: {
          dateTime: new Date(new Date(dateTime).getTime() + 30 * 60000).toISOString(),
          timeZone: Intl.DateTimeFormat().resolvedOptions().timeZone,
        },
        reminders: { useDefault: true },
      };
      const response = await axios.post(
        '/api/create-event',
        { event, email: user.email },
        { headers: { Authorization: `Bearer ${sessionToken}` } }
      );
      alert(`Event created: ${response.data.summary} at ${new Date(response.data.start.dateTime).toLocaleString()}`);
      setMessage('');
      setDateTime('');
    } catch (err) {
      alert('Failed to create event. Please try again.');
      console.error(err);
    } finally {
      setLoading(false);
    }
  }

  return (
    <AuthProvider projectId="P321NcYgY3z0ACnbCyQyA3rWmY3V">
      <div style={{ maxWidth: 600, margin: '40px auto', padding: 20 }}>
        <h1 style={{ textAlign: 'center', color: '#1473e6' }}>Neighborhood Help Coordinator</h1>
        {!user ? (
          <Descope
            flowId="help-agent-flow"
            theme="light"
            onSuccess={(e: any) => {
              setUser(e.detail.user);
              setSessionToken(e.detail.session.token);
              setConsentSuccess(true);
            }}
            onError={(err: any) => {
              alert('Authentication error. Please try again.');
              console.error(err);
            }}
          />
        ) : (
          <>
            {consentSuccess && (
              <div style={{ margin: '20px 0', padding: 10, background: '#e6ffe6', borderRadius: 6 }}>
                <strong>Authentication and consent successful!</strong> You can now use the app.
                <br />
                <small>This site is protected by hCaptcha and its <a href="https://www.hcaptcha.com/privacy" target="_blank" rel="noreferrer">Privacy Policy</a> and <a href="https://www.hcaptcha.com/terms" target="_blank" rel="noreferrer">Terms of Service</a> apply.</small>
              </div>
            )}
            <div style={{ marginBottom: 20 }}>
              Welcome, <strong>{user.name || user.email}</strong>! You’re signed in.
            </div>
            <textarea
              placeholder="Describe your help request or offer..."
              value={message}
              onChange={(e: React.ChangeEvent<HTMLTextAreaElement>) => setMessage(e.target.value)}
              rows={4}
              style={{ width: '100%', padding: 10, fontSize: 16, borderRadius: 6, border: '1px solid #ccc', marginBottom: 15 }}
            />
            <input
              type="datetime-local"
              value={dateTime}
              onChange={(e: React.ChangeEvent<HTMLInputElement>) => setDateTime(e.target.value)}
              style={{ width: '100%', padding: 10, fontSize: 16, borderRadius: 6, border: '1px solid #ccc', marginBottom: 20 }}
            />
            <button
              onClick={createEvent}
              disabled={loading}
              style={{
                width: '100%',
                backgroundColor: '#1473e6',
                color: 'white',
                padding: '12px 0',
                fontSize: 18,
                fontWeight: 'bold',
                border: 'none',
                borderRadius: 6,
                cursor: loading ? 'not-allowed' : 'pointer',
                transition: 'background-color 0.3s',
              }}
            >
              {loading ? 'Creating Event...' : 'Create Help Event'}
            </button>
            <button
              onClick={() => {
                setUser(null);
                setSessionToken(null);
                setMessage('');
                setDateTime('');
                setConsentSuccess(false);
              }}
              style={{
                width: '100%',
                marginTop: 15,
                backgroundColor: '#f44336',
                color: 'white',
                padding: '10px 0',
                fontSize: 16,
                borderRadius: 6,
                border: 'none',
                cursor: 'pointer',
              }}
            >
              Sign out
            </button>
          </>
        )}
      </div>
    </AuthProvider>
  );
}
